he Gujarati brothers that formed the duo, Kalyanji Virji Shah and Anandji Virji Shah. Some of their bestknown works are Don, Bairaag, Saraswatichandra, Qurbani and Safar. They won the 1975 Filmfare Award for Best Music Director for Kora Kagaz. The composers composed some outstanding songs rendered by the legend Kishore Kumar such as Jeevan se bhari teri aankhe, Zindagi ka safar hai ye kaisa Safar, Pal pal dilke paas, Neele Neele Ambar Par. Their composition called Pal bharke liye was used in an episode of The Simpsons. Remixed version of the song Apni Toh Jaise Taise, originally from the 1981 film Laawaris was used in 2010 Bollywood film Housefull.</p>','0000-00-00','0000-00-00',1,'',NULL,1,'kalyanjianandji'),(3282,'Kalyan Mukherjee',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kalyanmukherjee'),(3283,'Kalyan Mukhopadhyay',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'kalyanmukhopadhyay'),(3284,'Kalyan Sahai Sharma',12,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kalyansahaisharma'),(3285,'Kalyan Sen Barat',14,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kalyansenbarat'),(3286,'Kalyen Sahai Sharma',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'kalyensahaisharma'),(3287,'Kamaal Khan',14,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamaalkhan'),(3288,'Kamal',31,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamal'),(3289,'Kamala',9,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamala'),(3290,'Kamala Bai',9,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamalabai'),(3291,'Kamala Basu',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamalabasu'),(3292,'Kamala Chandrababu',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamalachandrababu'),(3293,'Kamala Devi',9,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamaladevi'),(3294,'Kamala Jharia',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamalajharia'),(3295,'Kamala Kailashana Th',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamalakailashanath'),(3296,'Kamalakar Rao',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamalakarrao'),(3297,'Kamala Keswani',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamalakeswani'),(3298,'Kamala Pattadar',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kamala