re Kumar',63,'8/71/41/kishore-kumar1_1398418410.jpg','<p>Abhas Kumar Ganguly was a popular Indian film playback singer. He is also known as an actor, lyricist, composer, producer, director, screenwriter and scriptwriter. Kishore Kumar sang in many Indian languages including Bengali, Hindi, Marathi, Assamese, Gujarati, Kannada, Bhojpuri, Malayalam and Oriya. He won 8 Filmfare Awards for Best Male Playback Singer and holds the record for most number of Filmfare Awards won in that category. He was awarded the Lata Mangeshkar Award by the Madhya Pradesh government and from that year onwards, the Madhya Pradesh Government initiated a new award called the Kishore Kumar Award for contributions to Hindi cinema.</p>','1929-08-04','1987-10-13',1,'',NULL,1,'kishorekumar'),(3589,'Kishori Amonkar',30,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kishoriamonkar'),(3590,'Kittu',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kittu'),(3591,'K Jaiswal',10,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kjaiswal'),(3592,'K Jamuna Rani',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kjamunarani'),(3593,'K J Rani',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'kjrani'),(3594,'K J Yesudas',26,'5/86/43/yeshu_1398063452.jpg','<p>Yesudas sings Indian classical, devotional, and popular music. He has recorded more than 50,000 songs in many languages including Malayalam, Tamil, Hindi, Kannada, Telugu, Bengali, Gujarati, Oriya, Marathi, Punjabi, Sanskrit, Tulu, Malay, Russian, Arabic, Latin and English during a career spanning five decades. He has performed in most Indian languages except Assamese, Konkani and Kashmiri. He also composed a number of Malayalam film songs in the 1970s and 1980s. Yesudas is fondly called Gana Gandharvan.</p>','1940-01-10','0000-00-00',1,'',NULL,1,'kjyesudas'),(3595,'K K',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kk'),(3596,'K Kay',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'kkay'),(3597,'K Khalle',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'kkhalle'),(3598,'K K Mahalakshmi',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'kkmahalakshmi'),(3599,'