December 24, 1924 &ndash; July 31, 1980 was an Indian recording artist who is considered by many to be one of the greatest Indian playback singers of all time in Hindi Film Industry. In his lifetime, he was awarded the National Film Award, Best National Singer Award and six Filmfare Awards In 1967, he was honoured with the Padma Shri award by the Government of India. In 2000, the Stardust magazine named him the Best Singer of the Millenium. His singing career spanned about 35 years, and he is noted for his ability to sing songs of different moods and varieties. His songs ranged from classical numbers to patriotic songs, sad lamentations to highly romantic numbers, qawwalis to ghazals and bhajans. He is best known for romantic and duet songs, which he playback sings with the technique to mould the voice according to characters of the actor on the screen.</p>','1924-12-24','1980-07-31',1,'',NULL,1,'mohdrafi'),(4677,'Mohammed Saddiq',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'mohammedsaddiq'),(4678,'Mohammed Saddique',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'mohammedsaddique'),(4679,'Mohammed Sadiq',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'mohammedsadiq'),(4680,'Mohammed Salamat',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'mohammedsalamat'),(4681,'Mohammed Sayeed',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'mohammedsayeed'),(4682,'Mohammed Sayeed Khan',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'mohammedsayeedkhan'),(4683,'Mohammed Sazid',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'mohammedsazid'),(4684,'Mohammed Shafi Neyaji Qawal',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'mohammedshafineyajiqawal'),(4685,'Mohammed Sikander Alam',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'mohammedsikanderalam'),(4686,'Mohammed Sulaiman',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'mohammedsulaiman'),(4687,'Mohammed Vakil',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'mohammedvakil'),(4688,'Mohammed Yunus',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'mohammedyunus'),(4689,'Mohan',61,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'mohan'),(4690,'Mohana',9,NULL,NULL