rn in a Tripuri family to the wellknown Bollywood composer-singer Sachin Dev Burman and his lyricist wife Meera Dev Burman, in Calcutta. Initially, he was nicknamed Tublu by his maternal grandmother although he later became known by the nickname of Pancham. According to some stories, he was nicknamed as Pancham because, as a child, whenever he cried, it sounded in the fifth note Pa of the Indian musical scale. The word Pancham means five or fifth in Bengali. Another theory says that the baby was nicknamed Pancham because he could cry in five different notes. Yet another version is that when the veteran Indian actor Ashok Kumar saw a newborn Rahul uttering the syllable Pa repeatedly, he nicknamed the boy Pancham.</p>','1939-06-27','1994-01-04',1,'',NULL,1,'rdburman'),(6639,'Reba',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'reba'),(6640,'Reba Devi',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'rebadevi'),(6641,'Reba Muhuri',10,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'rebamuhuri'),(6642,'Reba Som',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'rebasom'),(6643,'Rebimbus',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'rebimbus'),(6644,'Reddy',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'reddy'),(6645,'Reema Lagoo',9,NULL,NULL,NULL,NULL,2,NULL,NULL,1,'reemalagoo'),(6646,'Reena',9,NULL,NULL,NULL,NULL,2,NULL,NULL,1,'reena'),(6647,'Reena Rajan',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'reenarajan'),(6648,'Reena Rajnaryan Dash',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'reenarajnaryandash'),(6649,'Reena Roy',9,NULL,NULL,NULL,NULL,2,NULL,NULL,1,'reenaroy'),(6650,'Reenie',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'reenie'),(6651,'Reeta',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'reeta'),(6652,'Reeta Baruah',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'reetabaruah'),(6653,'Rehana',9,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'rehana'),(6654,'Rehana Mirza',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'rehanamirza'),(6655,'Rehana Samim',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'rehanasamim'),(6656,'Rehna',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'rehna'),(6657,'Rekha',41,NULL,NULL,NU