andra Dev Burman, the only son of Ishanachandra Dev Burman, Raja of Tripura. His father hailed from the kokborok speaking royal family of Tripura while his mother hailed from the Manipuri speaking royal family of Manipur.Sachin was the youngest of the five sons, of his parents, who had nine children in all. He did his BA from Comilla Victoria College and MA from Calcutta University. He started his formal music education by training under the famous musician K C Dey from 1925 to 1930 thereafter in 1932 he came under the tutelage of Bhismadev Chattopadhaya, who was only three years his senior. This was followed by training from Kahifa Badal Khan, Sarangi player, and Ustad Allauddin Khan. Eventually he got KC Dey, Ustad Badal Khan and Allauddi Khan into Agartala, noted Bengal poet laureate, Kazi Nazrul Islam also spent time in their family home, Comilla House, in Agartala and Comilla.</p>','1906-10-01','1975-10-31',1,'',NULL,1,'sdburman'),(7385,'S D Subbalakshmi',9,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'sdsubbalakshmi'),(7386,'Sebastian James',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'sebastianjames'),(7387,'Sebastian Joseph',10,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'sebastianjoseph'),(7388,'Seema',15,NULL,NULL,NULL,NULL,2,NULL,NULL,1,'seema'),(7389,'Seema Advani',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'seemaadvani'),(7390,'Seema Alimchandani',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'seemaalimchandani'),(7391,'Seema Choure',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'seemachoure'),(7392,'Seema Deo',9,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'seemadeo'),(7393,'Seema Devi',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'seemadevi'),(7394,'Seema Sharma',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'seemasharma'),(7395,'Seema Trivedi',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'seematrivedi'),(7396,'seergazhi Govindarajan',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'seergazhigovindarajan'),(7397,'Seerkhazhi G Sivachidambaram',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'seerkhazhigsivachidambaram'),(7398,'Seerkhazhi S Thirugnana Sambantham',8,N