NULL,1,NULL,NULL,1,'shankargurung'),(7556,'Shankar Jaikishan',30,'b/2b/f4/shankar-jaikishan_1398063304.jpg','<p>Shankar Jaikishan also known as SJ, were a duo who composed Indian music for the Hindi film industry, who worked together from 1949&ndash;1971. ShankarJaikishan, along with other artists, wrote everlasting and immortal melodies in the fifties and sixties. Their best work was noted for being raga-based and having both lilt and sonority. Shankar-Jaikishan\'s compositions broke new ground in Hindi film music. Apart from relying upon their knowledge of Indian classical music, they also employed western beats and orchestration.</p>','0000-00-00','0000-00-00',1,'',NULL,1,'shankarjaikishan'),(7557,'Shankar Khandagle',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shankarkhandagle'),(7558,'Shankar Lal Mukherjee',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shankarlalmukherjee'),(7559,'Shankar Mahadevan',10,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shankarmahadevan'),(7560,'Shankar Qawal',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shankarqawal'),(7561,'Shankarrao Kalpeshwari',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shankarraokalpeshwari'),(7562,'Shankar Shambhu Qawwal',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shankarshambhuqawwal'),(7563,'Shankar Vaidya',12,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shankarvaidya'),(7564,'Shankar Yadav',12,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shankaryadav'),(7565,'Shankha Ghosh',12,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shankhaghosh'),(7566,'Shanmuga Vadivu',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shanmugavadivu'),(7567,'Shanmukhi Anjaneyaraju',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'shanmukhianjaneyaraju'),(7568,'Shano Banerji',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shanobanerji'),(7569,'Shanoli Majumder',8,NULL,NULL,NULL,NULL,1,NULL,NULL,-1,'shanolimajumder'),(7570,'Shanta',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shanta'),(7571,'Shanta Apte',9,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shantaapte'),(7572,'Shanta B A',8,NULL,NULL,NULL,NULL,1,NULL,NULL,1,'shantaba'),(7573,'Shanta Hublikar',9,NULL,NUL